faga.df:
slightly sloping roof of house, which is poor for water runoff;
  opposite of koriente. |I atof guma' senfaga. |The roof of the
  house is very slightly sloping

fotda.df:
worn blade, blade with a shallow cutting edge like a chisel;
  opposite of hatma. |Fotda i filon machette. |The blade of the
  machete is worn

guili.zb:
rudder fish--ranges in color from silverish to very  dark;
  usually found in surge pools of reef; darker  variety found in large
  coral caves in deeper waters  bordering the reef

kubu.df:
digging tool--with straight, sharp blade and long heavy handle;
  used for digging large holes, such as those needed for planting
  banana trees

mestisa.df:
mestizo, half-breed, a person of mixed blood (f);
  Blouse--formal, esp. used by elder women for religious or formal
  ceremonies

raya.df:
line, rule, underline, to scratch or mark a smooth surface;
  line--as on ruled paper, a line on the road to mark lanes, stripe,
  as in rank in service

sakmoneten acho'.df:
type of fish-parupeneus trifasciatus (family mullidae);
  goatfishes
al   satmonete acho'

suman.df:
type of food--made from rice and coconut milk; after rice is
  cooked in coconut milk, it is wrapped in banana leaf and steamed;
  usually served as a dessert

tuba.df:
bud of coconut tree, juice which is tapped from bud of coconut
  tree which ferments very quickly; beverage from sap of coconut tree;
  coconut sap, toddy, notch put in a tree to ease climbing

tun.df:
mister, sir--used as respect when addressing an elderly male;
  distinct from Ton| in speech of some Chamorros; Ton| is more
  formal
